import React from 'react';
import Img1 from '../assets/nature.jpg';
import Img2 from '../assets/sunset.jpg';


class Photo extends React.Component {

    render()  {
        return(
            <div>
                <img src={Img1} alt="Img1"/>
                <img src={Img2} alt="Img2"/>
            </div>
        );
    }
}
export default Photo;
